import React from 'react'
import { useAuth } from '../Context/AuthContext'
import { useNavigate } from 'react-router-dom';

const Navbar = () => {
    const navigate = useNavigate()
    const {logout, isloggedin} = useAuth();
  return (
    <nav class="navbar navbar-expand-lg navbar-light bg-light">
    <a class="navbar-brand mx-5" href="#">Navbar</a>
    {isloggedin && <>
        <div class="collapse navbar-collapse" id="navbarNav">
    <ul class="navbar-nav">
      <li class="nav-item active">
        <a class="nav-link" href="#">Home</a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">Features</a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">Pricing</a>
      </li>
    </ul>
    </div>
    </>
    }
    
    
    
   
    {isloggedin ?  <button type="button" onClick={()=>{logout()}} class="btn btn-outline-dark m-2">Log Out</button>: <button type="button" onClick={(e) => {navigate("/login")}} class="btn btn-outline-dark m-2">Log in</button>}
   
    </nav>
  )
}

export default Navbar
